// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.6.12;

import "./FotToken.sol";
import "./StandardToken.sol";
import "./StandardTokenFactory.sol";

contract FotTokenFactory is Ownable, CloneFactory {
    address payable private masterContract;
    event TokenCreated(address id, address newTokenAddress);
    address newOwner;
    address payable public clone;
    constructor (address payable contractToClone) public {
        masterContract = contractToClone;
    }
    function createToken(
        string memory name,
        string memory symbol,
        uint256 basicSupply,
        uint256 decimals,
        uint256 multiplier,
        uint256 numMinTokensToSell,
        uint256 maxTxnAmount,
        address dexAddress
    ) public payable {
        clone = createClone(masterContract);
        FotToken(clone).init(
            name,
            symbol,
            basicSupply,
            decimals,
            multiplier,
            numMinTokensToSell,
            maxTxnAmount,
            dexAddress,
            _msgSender()
        );
        emit TokenCreated(_msgSender(), clone);
    }
}
